function selectFieldChange(){}var helpOpen;function helpMouseover(){}function helpMouseout(){}function whisperClick(b,c){var a=getTarget(b);if(isTag(a,"a")&&!(b.button||b.shiftKey||b.altKey||isCtrl(b))){c.value=a.firstChild.data;c.previousSibling.value=decodeURIComponent(a.href.replace(/.*=/,""));c.nextSibling.style.display="none";return false}}function whisper(a,b){if(b.orig!=b.value){b.orig=b.value;b.previousSibling.value=b.value;return ajax(a+encodeURIComponent(b.value),function(d){if(d.status&&b.orig==b.value){b.nextSibling.innerHTML=d.responseText;b.nextSibling.style.display="";var c=b.nextSibling.firstChild;if(c&&c.firstChild.data==b.value){b.previousSibling.value=decodeURIComponent(c.href.replace(/.*=/,""));c.className="active"}}})}};